CALLING A MEETING!
in the last week I have met up with 5 brand new creative faces all across Indiana: from coffee dates, to simply chatting, snapping content for one another, and teaching lessons on the things social media has helped me and killed me on — every single one of these connections were generated right here, on INSTAGRAM from a simple dm. how fun is that?! well, one of my biggest weaknesses in social media (that I talked to each one of these individuals about this week) is my ability to completely forget to share the little things. the behind-the-scenes, the small (yet crucial) details that get each of the projects and things I do live, I sleep 6 hours at night — other than that I am frivolously, 100%, building this (my self brand) I’m not a college girl, I may be 19 but am an old soul, who very rarely believes in and enjoys down time. I’m passionate about what I do and won’t stop until I do it. but I get so wrapped up into this, I forget to share what "it" even is sometimes.

OR how I get to the end of a week and realize I posted only 1 screenshot featuring 1 of the 5 amazing girls I met this week. THAT'S HORRIBLE! 
so, I'm pleased to introduce you to #MCMeets on Twitter. 
overall it's a way for me to better communicate the things I’m doing in these meetings - lessons I’m learning, what we are discussing, formed into a simple (140 character) tweet with a tag to whom it was with. super simple I know - but its the first step in better sharing the small things. and the energy that is generated when I meet these individuals is something I wish I could gift to all of you. It's like the creative version of adrenaline, and I’m ready to sprinkle the shit alllllll over.

the rest can wait for another day, but for now, feel free to join in on Twitter @maddy_corbin #MCMeets
